public static boolean getPropertyBool(Map<String, String> props, String name,
    boolean defaultValue) {
  String value = props.get(name);
  if (StringUtils.isEmpty(value)) {
    return defaultValue;
  }
  return Boolean.parseBoolean(value);
}
